import React from 'react';

const List = (props) => (
  <ul>
    {props.items.map((item) => (
    <li key={item}> {item} </li>
  ))}
  </ul>
);
const ListContainer = () => (
  <List items={['Learn React', 'Testing']} />
)
export default List;
